description:
This is a video I made for the Fugazi song Blueprint off the Repeater album

I made this one a long time ago, when George Bush was still around and you couldn't stream anything much bigger than vcd size, so this is gonna look its crispest at 352x240.The bulk of the animation is from a cartoon called &quot;Brother, Can you spare a job&quot; By Tom Neely, Greg Saunders. The other stuff is from random clips i had sitting around on my hard drive. 

Even though we have a new president, the economy hasnt improved all that much, so I still think this video holds its relevance

